import './styles/Console.css';
import { useGeneratedCode } from '../GeneratedCodeContext';

function TextCode() {

    const { generatedCode } = useGeneratedCode();

    return (
        <div className="console">
            <div className="title">Generated Code</div>
            <div className="consoleContent" dangerouslySetInnerHTML={{ __html: generatedCode }} />

            <div className="consoleContent">
                {outputText.split('\n').map((line, i) => {
                    const className = line.startsWith('Error') ? 'error' : '';
                    return <div key={i} className={className}>{line}</div>
                })}
            </div>
        </div>
    );
}

export default TextCode;
